//---------------------------------------------------------------------------
bool DisplayClass::IsValidData(const unsigned char *Data)
{
	if (std::memcmp(Data, "\x00\xFF\xFF\xFF\xFF\xFF\xFF\x00", 8) != 0)
		return false;

	return true;
}
//---------------------------------------------------------------------------
bool DisplayClass::FixData(unsigned char *Data, bool Override)
{
	unsigned char CompareData[127];

	if (!IsValidData(Data))
		return false;

	std::memset(&Data[12], 0, 4);

	if (Data[18] != 1 || Data[19] != 4)
	{
		Data[18] = 1;
		Data[19] = 3;

		if (Data[20] & 128)
			Data[20] = 128;
	}

	Data[24] |= 2;

	if (Override)
	{
		if (Data[126] == 1)
		{
			std::memset(CompareData, 0, 127);
			CompareData[0] = 0x02;
			CompareData[1] = 0x03;

			if (std::memcmp(&Data[128], CompareData, 127) == 0)
				Data[126] = 0;
		}
	}
	else
	{
		if (Data[126] == 1)
		{
			std::memset(CompareData, 0xFF, 127);

			if (std::memcmp(&Data[128], CompareData, 127) == 0)
				Data[126] = 0;
		}
	}

	return true;
}
//---------------------------------------------------------------------------
bool DisplayClass::Import(const char *FileName, bool Complete)
{
	std::FILE *File = std::fopen(FileName, "rb");

	if (!File)
		return false;

	DisplayWrite();
	OverrideData[126] = 0;

	if (!ImportFile(File, Complete, "(b)"))
	if (!ImportFile(File, Complete, "(hhhhhhhhhhhhhhhh)"))
	if (!ImportFile(File, Complete, "l(hhhhhhhhhhhhhhhh)"))
	if (!ImportFile(File, Complete, "(xcxcxcxcxcxcxcxcxcxcxcxcxcxcxcxc)"))
	if (!ImportFile(File, Complete, "l(xcxcxcxcxcxcxcxcxcxcxcxcxcxcxcxc)"))
	if (!ImportFile(File, Complete, "lll(oshhhhhhhhhhhhhhhh)"))
	if (!ImportFile(File, Complete, "lll(sshhhhhhhhhh)"))
	if (!ImportINF(File, Complete))
	if (!ImportEXE(File, Complete))
	{
		std::fclose(File);
		return false;
	}

	std::fclose(File);
	FixData(OverrideData, true);
	DisplayRead();
	return true;
}
//---------------------------------------------------------------------------
bool DisplayClass::ImportFile(std::FILE *File, bool Complete, const char *Format)
{
	PropertiesClass Properties;
	unsigned char Buffer[128];
	int Index;
	int Block;
	const char *Byte;
	const char *Start;
	int Hex;
	char Text[256];
	bool Valid = false;
	bool Status = false;

	rewind(File);
	Index = 0;
	Block = 0;

	for (Byte = Format; Block < MAX_EDID_BLOCKS; Byte++)
	{
		switch (*Byte)
		{
			case '(':
				Start = Byte;
				break;

			case ')':
				Byte = Start;
				break;

			case 'b':
				if (std::fread(&Buffer[Index], 1, 128, File) != 128)
					return Status;

				Index += 128;
				break;

			case 'c':
				if (std::fgetc(File) == EOF)
					return Status;

				break;

			case 'h':
				if (std::fscanf(File, "%2x", &Hex) != 1)
					return Status;

				Buffer[Index] = Hex;
				Index++;
				break;

			case 'l':
				if (!std::fgets(Text, 256, File))
					return Status;

				break;

			case 'o':
				if (std::fscanf(File, "%x", &Hex) != 1)
					return Status;

				if (Hex % 128 != Index)
					return Status;

				if (Hex / 128 < Block)
					return Status;

				if (Index == 0)
					Block = Hex / 128;

				break;

			case 's':
				if (std::fscanf(File, "%255s", Text) != 1)
					return Status;

				break;

			case 'x':
				if (std::fscanf(File, "%x", &Hex) != 1)
					return Status;

				if (Hex > 255)
					return Status;

				Buffer[Index] = Hex;
				Index++;
				break;

			default:
				return Status;
		}

		if (Index != 128)
			continue;

		if (Block == 0)
		{
			if (!IsValidData(Buffer))
				return Status;

			Valid = true;

			if (Complete)
				std::memcpy(OverrideData, Buffer, 128);
			else
				std::memcpy(&OverrideData[35], &Buffer[35], 93);

			if (!Status)
				std::memset(&OverrideData[128], 0, MAX_EDID_EXTENSION_BLOCKS * 128);

			Properties = OverrideProperties;
			Properties.Read(Buffer, true);
			Properties.ResetIncludes();

			if (Complete)
				OverrideProperties = Properties;
			else
				OverrideProperties.Import(Properties);

			Status = true;
		}
		else
		{
			if (!Valid && OverrideData[126] < Block)
				OverrideData[126] = Block;

			if (!Status)
				std::memset(&OverrideData[128], 0, MAX_EDID_EXTENSION_BLOCKS * 128);

			std::memcpy(&OverrideData[Block * 128], Buffer, 128);
			Status = true;
		}

		Index = 0;
		Block++;
	}

	return Status;
}
//---------------------------------------------------------------------------
bool DisplayClass::ImportINF(std::FILE *File, bool Complete)
{
	PropertiesClass Properties;
	unsigned char Buffer[128];
	char Line[1024];
	const char *Text;
	int Block;
	int Hex;
	int Index;
	bool Valid = false;
	bool Status = false;

	rewind(File);

	while (std::fgets(Line, 1024, File))
	{
		if (std::strchr(Line, '\x7F'))
			return Status;

		Text = std::strtok(Line, ", \"\r\n");

		if (!Text)
			continue;

		if (stricmp(Text, "HKR") != 0)
			continue;

		Text = std::strtok(NULL, ", \"\r\n");

		if (!Text)
			continue;

		if (stricmp(Text, "EDID_OVERRIDE") != 0)
			continue;

		Text = std::strtok(NULL, ", \"\r\n");

		if (!Text)
			continue;

		if (std::sscanf(Text, "%d", &Block) != 1)
			continue;

		if (Block < 0 || Block >= MAX_EDID_BLOCKS)
			continue;

		Text = std::strtok(NULL, ", \"\r\n");

		if (!Text)
			continue;

		if (std::sscanf(Text, "%x", &Hex) != 1)
			continue;

		if (Hex != 1)
			continue;

		for (Index = 0; Index < 128; Index++)
		{
			Text = std::strtok(NULL, ", \"\r\n");

			if (!Text)
				break;

			if (std::sscanf(Text, "%x", &Hex) != 1)
				break;

			if (Hex > 255)
				break;

			Buffer[Index] = Hex;
		}

		if (Index != 128)
			return Status;

		Text = std::strtok(NULL, ", \"\r\n");

		if (Text)
			return Status;

		if (Block == 0)
		{
			if (!IsValidData(Buffer))
				return Status;

			Valid = true;

			if (Complete)
				std::memcpy(OverrideData, Buffer, 128);
			else
				std::memcpy(&OverrideData[35], &Buffer[35], 93);

			if (!Status)
				std::memset(&OverrideData[128], 0, MAX_EDID_EXTENSION_BLOCKS * 128);

			Properties = OverrideProperties;
			Properties.Read(Buffer, true);
			Properties.ResetIncludes();

			if (Complete)
				OverrideProperties = Properties;
			else
				OverrideProperties.Import(Properties);

			Status = true;
		}
		else
		{
			if (!Valid && OverrideData[126] < Block)
				OverrideData[126] = Block;

			if (!Status)
				std::memset(&OverrideData[128], 0, MAX_EDID_EXTENSION_BLOCKS * 128);

			std::memcpy(&OverrideData[Block * 128], Buffer, 128);
			Status = true;
		}
	}

	return Status;
}
//---------------------------------------------------------------------------
bool DisplayClass::ImportEXE(std::FILE *File, bool Complete)
{
	PropertiesClass Properties;
	const unsigned char Magic[] = {0x71, 0x42, 0x12, 0x83, 0x54, 0x24, 0x95, 0x66};
	const int DataSize = sizeof Magic + MAX_EDID_BLOCKS * 128;
	const int ReadSize = 4096;
	unsigned char Buffer[DataSize + ReadSize];
	int Size;
	int Index;

	rewind(File);
	Size = std::fread(&Buffer[DataSize], 1, ReadSize, File);
	Index = DataSize;

	if (Size < DataSize || memcmp(&Buffer[DataSize], "MZ", 2) != 0)
		return false;

	while (Size > 0)
	{
		while (Index <= Size)
		{
			if (memcmp(&Buffer[Index], Magic, sizeof Magic) == 0)
			{
				Index += sizeof Magic;

				if (!IsValidData(&Buffer[Index]))
					continue;

				if (Complete)
					std::memcpy(OverrideData, &Buffer[Index], DataSize);
				else
					std::memcpy(&OverrideData[35], &Buffer[Index + 35], DataSize - 35);

				Properties = OverrideProperties;
				Properties.Read(&Buffer[Index], true);
				Properties.ResetIncludes();

				if (Complete)
					OverrideProperties = Properties;
				else
					OverrideProperties.Import(Properties);

				return true;
			}

			Index++;
		}

		std::memcpy(Buffer, &Buffer[ReadSize], DataSize);
		Size = std::fread(&Buffer[DataSize], 1, ReadSize, File);
		Index = 1;
	}

	return false;
}
